import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { ServidoresRoutingModule } from './testing-routing.module';
import { MainTestingComponent } from './components/main-testing/main-testing.component';
import { TestJavaComponent } from './components/test-java';
import { TestJavascriptComponent } from './components/test-javascript';

@NgModule({
  declarations: [
    MainTestingComponent,
    TestJavaComponent,
    TestJavascriptComponent
  ],
  imports: [
    CommonModule,
    ServidoresRoutingModule
  ]
})
export class TestingModule { }
